let _callServices=()=>{fetch("../json/services.json").then(e=>e.json()).then(e=>{let t=document.getElementsByClassName("services"),l=e.services;l.map((e,l)=>{let s=document.createElement("div"),n=document.createElement("img"),a=document.createElement("h3");a.innerHTML=e.title,s.appendChild(n).src=e.img,s.appendChild(a).classList.add("align_center"),t[0].appendChild(s).classList.add("itemServices")})})},_callClients=()=>{fetch("../json/clients.json").then(e=>e.json()).then(e=>{let t=document.getElementsByClassName("clientes"),l=e.clientes;l.map((e,l)=>{let s=document.createElement("img");s.width=e.width,s.title=e.title,s.classList.add("cli-"+e.tipo),t[0].appendChild(s).src=e.img})})},_callGallery=()=>{fetch("../json/gallery.json").then(e=>e.json()).then(e=>{let t=document.getElementsByClassName("gallery"),l=e.gallery;l.map((e,l)=>{let s=document.createElement("div");s.classList.add("itemGallery");let n=document.createElement("img");n.title=e.title,n.src=e.img,s.appendChild(n),t[0].appendChild(s)})})},sticky=0,_fixedHeader=()=>{let e=document.getElementById("header");sticky=parseInt(e.offsetTop)+300,window.pageYOffset>sticky?e.classList.add("fixedHeader"):e.classList.remove("fixedHeader")},_parallaxSlider=()=>{let e=document.getElementById("sliderPrincipal"),t=window.pageYOffset;e.style.backgroundPosition="center "+-.15*t+"px"};_callGallery(),_callServices(),_callClients(),window.onload=(()=>{window.onscroll=(()=>{_parallaxSlider(),_fixedHeader()})});